css:
@-moz-document domain(youtube.com)
{
  #logo-container .logo,
	.footer-logo-icon,
	#logo-icon,
	#logo-icon-container
  {
    content: url('https://upload.wikimedia.org/wikipedia/commons/2/20/CyanTube_Logo_Light.png') !important;
    width: 88px !important;
    height: 17px !important;
    background-image: none !important;
  }

  html[dark] #logo-icon,
	html[dark] #logo-icon-container
  {
    content: url('https://upload.wikimedia.org/wikipedia/commons/3/3b/CyanTube_Logo.png') !important;
    width: 88px !important;
    height: 17px !important;
    background-image: none !important;
  }
}
